import React from 'react';
import s from './User.module.css'

const User = ({user}) => {
    //let user = props.user;
   // alert(user.name)
    return (
        <div className={s.user}>
            <div className={s.userName}>{user.name} {user.surname}</div>
            <div className={s.desc}>{user.desc}</div>
        </div>
    )
}

export default User
